import React, { useEffect, useState } from 'react'
import apiServer from '../services/apiService'
import Card from '../Card'

export default function Users() {
    const [object, setObject] = useState(null);
    useEffect(() => {
        apiServer.then(res => {setObject(res) })
    }, [])

    return (
        <div style={{display: 'flex',width: '100vh'}}>
            {object && object.map((item, index) => <Card key={index} name={item.name.first +' ' + item.name.last} age = {item.age} email = {item.email} picture = {item.picture}/>)}
        </div>
    )
}
